import React, { Component } from "react";

class Kategori extends Component {
  render() {
    return (
      <div>
        <h2>Kategori Utama</h2>
        <Container>
  <Row>
    <Col>1 of 2</Col>
    <Col>2 of 2</Col>
  </Row>
  <Row>
    <Col>1 of 3</Col>
    <Col>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>;

      </div>
    );
  }
}

export default Kategori;
